import React from "react";

function Intro(){
    return(
        <div>
            <p>\Plant diseases have caused severe losses to humans in several ways. Starvation and uprooting of families resulted from the Irish famine caused by potato late blight (caused by Phytophthora infestans). A valued resource was lost with the virtual elimination of the American chestnut by chestnut blight (caused by Cryphonectria parasitica). And direct economic loss such as the estimated one billion dollars lost in one year to American corn growers from southern corn leaf blight (caused by Cochliobolus maydis, anamorph Bipolaris maydis). Many plant diseases cause less dramatic losses annually throughout the world but collectively constitute sizable losses to farmers and can reduce the aesthetic values of landscape plants and home gardens.</p>
        </div>
    )
}

export default Intro;
